import './App.css';
import start from './App';
function Start(){
  alert("hi");
}
function App() {
  return (
    <div>
   <div className='watch'><span className='time' id='hours'>00</span>:<span className='time' id='mins'>00</span>:<span className='time' id='secs'>00</span>:<span className='time' id='millsecs'>00</span></div>
   <br />
   <div className='btns'>
    <button className='btn' onClick={start()}>Start</button>
    <button className='btn'>Pause</button>
    <button className='btn'>Lap</button>
    <button className='btn'>Restart</button>
   </div>
   <br />
   </div>
  );

}

export default App;
